<script setup lang="ts">
export type MuscleGroup =
    | 'chest'
    | 'lats'
    | 'traps'
    | 'rotatorCuffs'
    | 'lowerBack'
    | 'frontDelts'
    | 'sideDelts'
    | 'rearDelts'
    | 'triceps'
    | 'biceps'
    | 'forearms'
    | 'abs'
    | 'obliques'
    | 'glutes'
    | 'quads'
    | 'hamstrings'
    | 'adductors'
    | 'abductors'
    | 'calves'
    | 'neck';

const props = withDefaults(
    defineProps<{
      defaultMuscleColor?: string;
      backgroundColor?: string;
      primaryHighlightColor?: string;
      secondaryHighlightColor?: string;
      primaryOpacity?: number;
      secondaryOpacity?: number;
      selectedPrimaryMuscleGroups: MuscleGroup[];
      selectedSecondaryMuscleGroups?: MuscleGroup[];
    }>(),
    {
      defaultMuscleColor: '#1f1f1f',
      backgroundColor: '#000000',
      primaryHighlightColor: '#ff0000',
      secondaryHighlightColor: '#ff0000',
      primaryOpacity: 0.5,
      secondaryOpacity: 0.2
    }
);

function getStyle(muscleGroup?: MuscleGroup) {
  if (props.selectedPrimaryMuscleGroups && muscleGroup) {
    if (props.selectedPrimaryMuscleGroups.includes(muscleGroup)) {
      return {
        fill: props.primaryHighlightColor,
        opacity: props.primaryOpacity
      };
    }
  } else if (props.selectedSecondaryMuscleGroups && muscleGroup) {
    if (props.selectedSecondaryMuscleGroups.includes(muscleGroup)) {
      return {
        fill: props.secondaryHighlightColor,
        opacity: props.secondaryOpacity
      };
    }
  }
  return {
    fill: props.defaultMuscleColor
  };
}
</script>
